class Customer extends React.Component{
  render(){
    return(
      <tbody>
      <tr>
      <td>{customer.name}</td>
      <td>{customer.phone}</td>
      <td>{customer.email}</td>
      <td>{customer.discount}</td>
      <td>{customer.visits}</td>
      <td>{customer.spend}</td>
      </tr>
      </tbody>
    );
  };
};
export default Customer;
